import * as React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";

export default function Searchbox() {
  return (
    <Box
      sx={{
        width: 1000,
        maxWidth: "100%",
        background: "white",
        borderRadius: "1rem",
      }}>
      <TextField fullWidth label="검색" id="searchbox" />
    </Box>
  );
}
